import React, { Component } from 'react';
import "./Slidebar.css"
//import Footer from "../component/Footer"
import LoginChange from "./LoginChange";
import VisualChange from "./VisualChange";
//import {NavBar_in} from '../component/AppBar_in';

class Slidebar extends Component{
    constructor(props){
        super(props);
        this.state = {
            clicktime:0
        }
    }
    render(){
        if (this.state.clicktime%2 === 0){
            return (
                <div >
                    <button id="Slidebar_btn_close" 
                    onClick={(e)=>{
                        e.preventDefault();
                        this.setState = {clicktime:this.state.clicktime+1}

                    }}></button>
                </div>
            )
        }else{
            return (
                <div id="Slidebar_container">
                    <button id="Slidebar_btn_open" 
                    onClick={(e)=>{
                        e.preventDefault();
                        this.setState = {clicktime:this.state.clicktime+1}

                    }}></button>
                    <VisualChange />
                    <LoginChange /> 
                </div>)
        }


    }
}

export default Slidebar;
